import { Card } from "../organisms/card"

function showCard(item) {
    return <Card key={item.id} ProductInfo={item} />

}
function displayAllRow(row, index) {
    return (
        <div key={index} className="row flex">
            {row.map(showCard)}
        </div>
    )
}
export { displayAllRow }
